import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.css";
import fire from "../../Config/Fire";
import style from "./"

class Home extends Component {
  constructor(props) {
    super(props);
    this.logout = this.logout.bind(this);
  }

  logout() {
    fire.auth().signOut();
  }

  render() {
    return (
      <div className={style.home} id="homeForm">
        <h3>Search your event</h3>
        <div className="form-group">
          <input
            type="search"
            name="search"
            className="form-control"
            id="exampleInputSearch"
            placeholder="Search..."
          />
        </div>
        <button onClick={this.logout} className="btn btn-danger" id="out">
          Log Out
        </button>
      </div>
    );
  }
}

export default Home;
